import React from "react";
import "./style.css";
import github from '../../utils/images/icons/github.png';
import linkedin from '../../utils/images/icons/linkedin.png'

const footerIcon = {
  width: '5%',
  padding: '1%'
}

const footerTray = {
  marginTop: '3%'
}

function Footer() {
  return (
      <div>
          <div style={footerTray}>
            <img style={footerIcon} src={github} alt=''></img>
            <img style={footerIcon} src={linkedin} alt=''></img>
          </div>
      </div>
  );
}

export default Footer;
